import React from "react";

import { heroData } from "../data";
import Header from "./Header";
import { motion } from "framer-motion";
import { fadeIn, staggerContainer } from "../variants";

const Hero = () => {
  const { pretitle, title, subtitle, btnText } = heroData;

  return (
    <section className="min-h-[980px] bg-hero bg-cover bg-right">
      <Header />
      <div className="container mx-auto min-h-[980px] flex ">
        <div className="text-white italic text-[24px] lg:text-[28px] font-primary lg:font-medium mb-1">
          {pretitle}
        </div>
        <h1 className="h1 mb-5">{title}</h1>
        <div className="text-white max-w-[540px] mb-8">{subtitle}</div>
        <button className="btn">{btnText}</button>
      </div>
    </section>
  );
};

export default Hero;
